   int VnHypoHelper::GetCentBin(double m_Tot_Et, int run_year){//Takes energy in TeV returns centrality over [0-70)%
      if(run_year==DATA_2011) m_Tot_Et*=1.041;//1.041 correction factor for 2011 data
      for(int i=0;i<N_CENT_MAX;i++){
         if(m_Tot_Et> centcuts[i]) return i;
      }
      return -1;
   }


